import { Component } from 'react';

import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {

      monsters: [
        {
          name: 'Linda',
          id: '11111sssss',
        },
        {
          name: 'Frank',
          id: '11111ttttt',


        },
        {
          name: 'Jacky',
          id: '11111yyyyy',

        },


      ]
    };

  }
  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map((monster) => {
            return (
              <div key={monster.id}><h1>{monster.name}</h1></div>

            );
          })
        }

      </div>
    );
  }
}

export default App;
